import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const todoList = [
    'React practice',
    'game time'
  ];
  return (
    <div className="App">
      {
        todoList.map( item => <p>item</p>)
      }
    </div>
  );
}

export default App;
